// src/components/TopCustomers.js
import React from "react";

export default function TopCustomers({ customers = [] }) {
  return (
    <div
      style={{
        padding: 12,
        background: "#fff",
        borderRadius: 8,
        boxShadow: "0 2px 6px rgba(0,0,0,0.06)",
      }}
    >
      <h3 style={{ margin: "0 0 12px 0" }}>Top Customers</h3>
      {customers.length === 0 ? (
        <div style={{ color: "#666" }}>No customers yet</div>
      ) : (
        <ul style={{ listStyle: "none", padding: 0, margin: 0 }}>
          {customers.map((c, index) => (
            <li
              key={c.id || index}
              style={{
                padding: "6px 0",
                borderBottom: "1px solid #eee",
                display: "flex",
                justifyContent: "space-between",
              }}
            >
              <span>{c.name || `${c.id || "Unknown"}`}</span>
              <span>â‚¹{Number(c.totalSpent || 0).toFixed(2)}</span>
            </li>
          ))}
        </ul>
      )}
    </div>
  );
}
